(function(window,$){$yml.pageBase=$yml.object.New({ctor:function(){var elName=$("[data-page-root]").data("pageRoot");if(!elName){console.log("warnging...."+"请先确认正确的定义了页面vm的dom元素，page-root数据属性的定义,应用出现的第一个警告,可以忽略")}else{this.vmEleName=elName}this.$vmPage=null},getVmEleName:function(){return this.vmEleName},vmInit:function(){if(!this.vmDef){console.log("warning...."+"页面没有定义vm设置方法vmDef");return}var childVmDefine=this.vmDef();var vmPage=avalon.define(childVmDefine);return vmPage},vmInitAfter:function($vmPage,$router){this.$vmPage=$vmPage;this.$router=$router;if(!this.pageReady){console.log("warnging..."+"请重写pageReady方法，需要在这个方法里写页面的业务逻辑")}else{var params=this.$router.$vm.navUrl.split("?");var paramObj=null;if(params.length>0){paramObj=avalon.unparam(params[1])}this.pageReady(paramObj)}}})})(window,$);
